import React, { useEffect, useState } from 'react';

const Home = () => {
    const [parts, setParts] = useState({});

    useEffect(() => {
        getParts();
    }, []);

    const getParts = async () => {
        try {
            const response = await fetch('/Parts/GetPartByName', {
                cache: 'no-store',  // Bypass the cache
            });
            const data = await response.json();
            setParts(data);
        } catch (error) {
            console.error('Error fetching parts:', error);
        }
    };

    return (
        <div>
            <h1>Hello, I am a functional component!</h1>
            <p>This is a simple example of a functional component in React.</p>
            <div>
                <h2>Part Details:</h2>
                <p>Sequence: {parts.Sequence}</p>
                <p>Item: {parts.Item}</p>
                <p>Material Quantity: {parts.MaterialQuantity}</p>
                <p>OUM: {parts.OUM}</p>
            </div>
        </div>
    );
};

export default Home;
